account_user_info_cancellation_alert_con:
Antes de iniciar el siguiente paso del proceso de cancelación de la cuenta, tenga en cuenta que cancelar la cuenta BitMart es una operación irreversible. Haga una copia de seguridad de toda la información y los datos relacionados con la cuenta de BitMart. Una vez que se cancele su cuenta de BitMart, no podrá volver a usarla, incluyendo, entre otros:

(1) No podrá iniciar sesión ni usar el servicio de BitMart (incluido el método de inicio de sesión de terceros);

(2) Una vez que se cancele la cuenta, todo el contenido, la información, los datos y los registros de los productos y servicios a los que se haya suscrito y haya utilizado a través de la cuenta se eliminarán o se anonimizarán y ya no habrá posibilidad de recuperarlos, acceder a ellos, obtenerlos o continuar usándolos. y recuperarlos y no tiene derecho a solicitarnos que los recuperemos (excepto que la ley disponga lo contrario);

(3) Si otros usuarios han denunciado su cuenta, está siendo investigado por un organismo de las fuerzas de la ley, o se somete a litigios o arbitraje durante la cancelación de la cuenta de BitMart, BitMart se reserva el derecho de finalizar el proceso de cancelación sin previo aviso.

La cancelación de su cuenta de BitMart no servirá para renunciar a su responsabilidad por las acciones realizadas en su cuenta antes de la cancelación.
